The Guide To Romance (Jim Powers, True Love / 2014)

Romance comes in unexpected and exciting ways. Enter the world of creative romance as these lovers find new ways to spark the passion in each others hearts. Cody surprises Ash with a surprise kidnapping for a weekend resort. Lilly entices her hardworking lover with lingerie and a trail of roses. Fun in the kitchen ends with fun in the boudoir for Slena and Seth. Ryan relaxes his lover with a soothing massage before some intense love making. Let Jim Powers be your guide on the path of sexual happiness!

Ash Hollywood, Johnny Castle, Seth Gamble, Zoey Monroe, Ryan Driller, Lilly Banks, Cody Sky

All Sex, Couples

